webpackJsonp([55306999093231],{367:function(e,a){e.exports={data:{markdownRemark:{html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/005-b99bac3fd35c942d9d7e8887abe72b71-0b8cc.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 690px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 57.80104712041884%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="005"\n        title=""\n        src="/static/005-b99bac3fd35c942d9d7e8887abe72b71-44d6a.png"\n        srcset="/static/005-b99bac3fd35c942d9d7e8887abe72b71-f4799.png 173w,\n/static/005-b99bac3fd35c942d9d7e8887abe72b71-b3b1d.png 345w,\n/static/005-b99bac3fd35c942d9d7e8887abe72b71-44d6a.png 690w,\n/static/005-b99bac3fd35c942d9d7e8887abe72b71-0b8cc.png 955w"\n        sizes="(max-width: 690px) 100vw, 690px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Az FRT-s zsargonban “Maulaként” is emlegetett FRC-004 a csapat 2011-es versenyautója, ami elődjénél 20 százalékkal könnyebb, mindössze 225 kilogrammot nyom. Ehhez társul a motor 85 lóerőre emelkedett teljesítménye, ami jelentős előrelépést jelent az autó menetdinamikai paraméterei terén. A fejlődés jegyében az autó minden részegysége javult a korábbiakhoz képest: az alkatrészek igényesebb anyagok felhasználásával készültek a beépített Dexler differenciálmű a Formula Student versenyautóhoz elérhető legjobb megoldás, a motorvezérlést pedig a szintén elhíresült MoTec rendszer látja el. A csapat teljesen áttervezte a sebességváltót és szimulációs szoftverek segítségével hónapokig csiszolta a futómű-geometriát.</p>\n<p>Az FRC-004 révén a BME Formula Racing Team 2011-ben csatlakozott a Formula Student csapatok élmezőnyéhez. A műegyetemisták versenyautója a silverstone-i sprintfutamon leggyorsabbak között szerepelt úgy, hogy az autó előzetes tesztelésére csak nagyon kevés idő jutott. Az angliai futam után viszont a csapat nem hagyott fel a munkával, így az augusztus végi, győri futamra már egy finomított versenyautóval készültek, ami a népes mezőny harmadik leggyorsabb nevezőjének bizonyult. Mivel a csapat tagjainak meggyőződése, hogy az FRC-004-ben további rejtett tartalékok lakoznak, további tesztek, finomított beállítások és az autóról szerzett bővebb információk révén szeretnék a meglévő konstrukciót még gyorsabbá tenni, hogy a 2012-es futamokon még jobb eséllyel szállhasson harcba a dobogós helyekért</p>',timeToRead:1,excerpt:"Az FRT-s zsargonban “Maulaként” is emlegetett FRC-004 a csapat 2011-es versenyautója, ami elődjénél 20 százalékkal könnyebb, mindössze 22…",frontmatter:{title:"FRC-005"},fields:{slug:"/frc-005"}}},pathContext:{slug:"/frc-005"}}}});
